INSERT INTO `emailhostingtemplate` VALUES (1,'COVID-19: Office Re-Opening (option 1)','[{[{ OfficeName }]}] Reopening Update','Good morning, \r\n\r\nWe want to extend a thank you to all of our patients affected by the closure of our office for your patience during these unprecedented times. We are looking forward to seeing you again. \r\n\r\nOur office will be re-opening soon. If you have not rescheduled your previous appointment, please contact us to do so.\r\n\r\nWe will be taking many precautions as we re-open, following local and state guidelines. This includes social distancing measures and increased sanitizing of the office.\r\n\r\nThank you, \r\n[{[{ OfficeName }]}]\r\n[{[{ OfficePhone }]}]','Good morning, \r\n\r\nWe want to extend a thank you to all of our patients affected by the closure of our office for your patience during these unprecedented times. We are looking forward to seeing you again. \r\n\r\nOur office will be re-opening soon. If you have not rescheduled your previous appointment, please contact us to do so.\r\n\r\nWe will be taking many precautions as we re-open, following local and state guidelines. This includes social distancing measures and increased sanitizing of the office.\r\n\r\nThank you, \r\n[{[{ OfficeName }]}]\r\n[{[{ OfficePhone }]}]',0,0,'Html',''),(2,'COVID-19: Office Re-Opening (option 2)','[{[{ OfficeName }]}] Re-Opening Update','Good morning,\r\n\r\nThank you for your patience during these unprecedented times, \r\nWe are happy to announce that [{[{ OfficeName }]}] will be re-opening for non-urgent procedures soon. \r\n\r\nOur hours of operation are Monday through Friday, 8:00 AM to 5:00 PM.\r\n\r\nIf you have not yet rescheduled your appointment, please contact us. \r\n\r\nWe will be taking many precautions as we re-open, following local and state guidelines. This includes social distancing measures and increased sanitizing of the office.\r\n\r\nThank you,\r\n[{[{ OfficeName }]}]\r\n[{[{ OfficePhone }]}]','Good morning,\r\n\r\nThank you for your patience during these unprecedented times, \r\nWe are happy to announce that [{[{ OfficeName }]}] will be re-opening for non-urgent procedures soon.\r\n\r\nOur hours of operation are Monday through Friday, 8:00 AM to 5:00 PM. \r\n\r\nIf you have not yet rescheduled your appointment, please contact us. \r\n\r\nWe will be taking many precautions as we re-open, following local and state guidelines. This includes social distancing measures and increased sanitizing of the office.\r\n\r\nThank you,\r\n[{[{ OfficeName }]}]\r\n[{[{ OfficePhone }]}]',0,0,'Html',''),(3,'Generic Promotion: Percentage off Treatment','Special Treatment Offer','Want a whiter smile? [{[{ OfficeName }]}] is now offering 15% off whitening treatments, now through the end of the month.\r\nGive us a call to schedule an appointment today!','Want a whiter smile? [{[{ OfficeName }]}] is now offering 15% off whitening treatments, now through the end of the month.\r\nGive us a call to schedule an appointment today!',0,0,'Html',''),(4,'Patient Portal','Patient Portal','Did you know that you can view recommended treatment, make payments, and communicate with your provider, all through our secure Patient Portal? \r\nContact us at [{[{ OfficePhone }]}] today for access to your Patient Portal account. \r\nThanks!','Did you know that you can view recommended treatment, make payments, and communicate with your provider, all through our secure Patient Portal? \r\nContact us at [{[{ OfficePhone }]}] today for access to your Patient Portal account. \r\nThanks!',0,0,'Html',''),(5,'End of Year Insurance','End of Year Insurance','Your insurance benefits will renew soon.  You have insurance remaining amounts that can be applied towards important dental treatment.  Our records show that you have treatment that still needs to be completed.\r\nPlease call our office at your earliest convenience to schedule an appointment.','Your insurance benefits will renew soon.  You have insurance remaining amounts that can be applied towards important dental treatment.  \r\nOur records show that you have treatment that still needs to be completed.\r\nPlease call our office at your earliest convenience to schedule an appointment.',0,0,'Html',''),(6,'Birthday','Happy Birthday!','Wishing you a happy and healthy Birthday! \r\nHope your day is full of smiles and memorable moments. \r\n\r\nFrom your friends at\r\n[{[{ OfficeName }]}]','<b>[[font:verdana|Happy Birthday!]]</b>\r\n\r\nWishing you a happy and healthy Birthday! \r\nHope your day is full of smiles and memorable moments. \r\n\r\nFrom your friends at\r\n[{[{ OfficeName }]}]',0,0,'Html',''),(7,'COVID-19: Office Re-Opening (option 3)','[{[{ OfficeName }]}] Re-Opening Update','Good morning,\r\n\r\nWe want to extend a thank you to all of our patients affected by the closure of our office for your patience during these unprecedented times. We are looking forward to seeing you again.\r\n\r\nOur office will be re-opening soon. If you have not rescheduled your previous appointment, please contact us to do so.\r\n\r\nWe will be taking many precautions as we re-open, following local and state guidelines. This includes social distancing measures and increased sanitizing of the office. Please check our website for updates.\r\n\r\nThank you, and we look forward to seeing you soon,\r\n\r\n\r\nDr. Jane Smith\r\n[{[{ OfficeName }]}]\r\n[{[{ OfficePhone }]}]','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n  <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\" />\r\n  <title>We Are Open!</title>\r\n  <style type=\"text/css\">\r\n    @import url(http://fonts.googleapis.com/css?family=Lato:400);\r\n\r\n    /* Take care of image borders and formatting */\r\n\r\n    img {\r\n      max-width: 600px;\r\n      outline: none;\r\n      text-decoration: none;\r\n      -ms-interpolation-mode: bicubic;\r\n    }\r\n\r\n    a {\r\n      text-decoration: none;\r\n      border: 0;\r\n      outline: none;\r\n      color: #21BEB4;\r\n    }\r\n\r\n    a img {\r\n      border: none;\r\n    }\r\n\r\n    /* General styling */\r\n\r\n    td, h1, h2, h3  {\r\n      font-family: Helvetica, Arial, sans-serif;\r\n    }\r\n	\r\n    td  {\r\n      font-weight: 400;\r\n    }\r\n\r\n    body {\r\n      -webkit-font-smoothing:antialiased;\r\n      -webkit-text-size-adjust:none;\r\n      width: 100%;\r\n      height: 100%;\r\n      color: #37302d;\r\n      background: #ffffff;\r\n    }\r\n\r\n    table {\r\n      background:\r\n    }\r\n\r\n    h1, h2, h3 {\r\n      padding: 0;\r\n      margin: 0;\r\n      color: #ffffff;\r\n      font-weight: bold;\r\n    }\r\n	\r\n	h1.black, h2.black, h3.black {\r\n		color: inherit;\r\n	}\r\n	\r\n	h1 {\r\n		font-size: 27px;\r\n	}\r\n\r\n    h3 {\r\n      color: #21c5ba;\r\n      font-size: 24px;\r\n    }\r\n  </style>\r\n\r\n  <style type=\"text/css\" media=\"screen\">\r\n    @media screen {\r\n       /* Thanks Outlook 2013! http://goo.gl/XLxpyl*/\r\n      td, h1, h2, h3 {\r\n        font-family: \'Lato\', \'Helvetica Neue\', \'Arial\', \'sans-serif\' !important;\r\n      }\r\n    }\r\n  </style>\r\n\r\n  <style type=\"text/css\" media=\"only screen and (max-width: 480px)\">\r\n    /* Mobile styles */\r\n    @media only screen and (max-width: 480px) {\r\n      table[class=\"w320\"] {\r\n        width: 320px !important;\r\n      }\r\n\r\n      table[class=\"w300\"] {\r\n        width: 300px !important;\r\n      }\r\n\r\n      table[class=\"w290\"] {\r\n        width: 290px !important;\r\n      }\r\n\r\n      td[class=\"w320\"] {\r\n        width: 320px !important;\r\n      }\r\n\r\n      td[class=\"mobile-center\"] {\r\n        text-align: center !important;\r\n      }\r\n\r\n      td[class=\"mobile-padding\"] {\r\n        padding-left: 20px !important;\r\n        padding-right: 20px !important;\r\n        padding-bottom: 20px !important;\r\n      }\r\n    }\r\n  </style>\r\n</head>\r\n<body class=\"body\" style=\"padding:0; margin:0; display:block; background:#ffffff; -webkit-text-size-adjust:none\" bgcolor=\"#ffffff\">\r\n<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" height=\"100%\" >\r\n  <tr>\r\n    <td align=\"center\" valign=\"top\" bgcolor=\"#ffffff\"  width=\"100%\">\r\n\r\n    <table cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\r\n      <tr>\r\n        <td width=\"100%\">\r\n          <center>\r\n            <table cellspacing=\"0\" cellpadding=\"0\" width=\"500\" class=\"w320\">\r\n              <tr>\r\n                <td valign=\"top\" style=\"padding:10px 0; text-align:center;\" class=\"mobile-center\">\r\n                  <img width=\"160\" src=\"https://www.opendental.com/images/logos/templateLogoSign.png\">\r\n                </td>\r\n              </tr>\r\n            </table>\r\n          </center>\r\n        </td>\r\n      </tr>\r\n      <tr>\r\n        <td valign=\"top\">\r\n          <!--[if gte mso 9]>\r\n          <v:rect xmlns:v=\"urn:schemas-microsoft-com:vml\" fill=\"true\" stroke=\"false\" style=\"mso-width-percent:1000;height:303px;\">\r\n            <v:fill type=\"tile\" src=\"https://www.opendental.com/images/logos/templateopensign.png\" color=\"#64594b\" />\r\n            <v:textbox inset=\"0,0,0,0\">\r\n          <![endif]-->\r\n          <div>\r\n            <center>\r\n							<table cellspacing=\"0\" cellpadding=\"0\" width=\"530\" height=\"375\" class=\"w320\">\r\n                <tr>\r\n                  <td>\r\n										<img style=\"width: 100%;\" src=\"https://www.opendental.com/images/logos/templateopensign.png\">\r\n									</td>\r\n                </tr>\r\n              </table>\r\n            </center>\r\n          </div>\r\n          <!--[if gte mso 9]>\r\n            </v:textbox>\r\n          </v:rect>\r\n          <![endif]-->\r\n        </td>\r\n      </tr>\r\n      <tr>\r\n        <td valign=\"top\">\r\n          <center>\r\n            <table cellspacing=\"0\" cellpadding=\"0\" width=\"500\" class=\"w320\">\r\n              <tr>\r\n                <td>\r\n\r\n                  <table cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\r\n                    <tr>\r\n                      <td class=\"mobile-padding\" style=\"text-align:left;\">\r\n                        <h1 class=\"black\">We will be seeing patients again soon!</h1><br>\r\n						Good morning,<br><br>\r\n \r\n						We want to extend a thank you to all of our patients affected by the closure of our office for your patience during these unprecedented times. We are looking forward to seeing you again.<br><br>\r\n						 \r\n						Our office will be re-opening soon. If you have not rescheduled your previous appointment, please contact us to do so.<br><br>\r\n\r\n						We will be taking many precautions as we re-open, following local and state guidelines. This includes social distancing measures and increased sanitizing of the office. Please check our <a href=\"https://www.opendental.com\">website</a> for updates.<br><br>\r\n\r\n						Thank you, and we look forward to seeing you soon,<br><br><br>\r\n\r\n\r\n						Dr. Jane Smith<br>\r\n						[{[{ OfficeName }]}]<br>\r\n						[{[{ OfficePhone }]}]<br>\r\n                      </td>\r\n                    </tr>\r\n					<tr>\r\n                      <td height=\"50\">\r\n					  &nbsp;\r\n					  </td>\r\n					</tr>\r\n                  </table>\r\n                </td>\r\n              </tr>\r\n              <tr>\r\n              </tr>\r\n            </table>\r\n          </center>\r\n        </td>\r\n      </tr>\r\n      <tr>\r\n      </tr>\r\n    </table>\r\n    </td>\r\n  </tr>\r\n</table>\r\n</body>\r\n</html>',0,0,'RawHtml',''),(8,'Automated Birthday','Happy Birthday','Wishing you a happy and healthy Birthday! Hope your day is full of smiles and memorable moments. From your friends at [{[{ OfficeName }]}]','<b>[[font:verdana|Happy Birthday!]]</b>\r\n\r\nWishing you a happy and healthy Birthday! \r\nHope your day is full of smiles and memorable moments. \r\n\r\nFrom your friends at\r\n[{[{ OfficeName }]}]',0,0,'Html','Birthday');
