INSERT INTO `wikipage` VALUES (1,0,'_Master','','<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\" \"http://www.w3.org/TR/html4/loose.dtd\">\r\n<head>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<style type=\"text/css\">\r\n<!--\r\n*{\r\n	border: 0px;\r\n	margin: 0px;\r\n}\r\nbody{\r\n	margin:		3px;\r\n	font-size:	9pt;\r\n	font-family:	arial,sans-serif;\r\n}\r\np{\r\n	margin-top: 0px;\r\n	margin-bottom: 0px;\r\n}\r\nh1, h1 a{\r\n	font-size:20pt;\r\n	color:#005677;\r\n}\r\nh2, h2 a {\r\n	font-size:16pt;\r\n	color:#005677;\r\n}\r\nh3, h3 a {\r\n	font-size:12pt;\r\n	color:#005677;\r\n}\r\nul{\r\n	list-style-position: inside;/*This puts the bullets inside the div rect instead of outside*/\r\n}\r\nol{\r\n	list-style-position: inside;\r\n}\r\nul .ListItemContent{\r\n	position: relative; left: -5px;/*Tightens up the spacing between bullets and text*/\r\n}\r\nol .ListItemContent{\r\n	position: relative; left: -1px;/*Tightens up the spacing between numbers and text*/\r\n}\r\na{\r\n	color:rgb(68,81,199);/*same blue color as wikipedia*/\r\n	text-decoration:none;\r\n}\r\na:hover{\r\n	text-decoration:underline;\r\n}\r\ntable, th, td, tr {\r\n	border-collapse:collapse;\r\n	border:1px solid #999999;\r\n	padding:2px;\r\n}\r\n.PageNotExists, a.PageNotExists {\r\n	border-bottom:1px dashed #000000;\r\n}\r\na.PageNotExists:hover {\r\n	border-bottom:1px solid #000000;\r\n	text-decoration:none;\r\n}\r\n.keywords, a.keywords:hover {\r\n	color:#000000;\r\n	background-color:#eeeeee;\r\n}\r\n-->\r\n</style>\r\n</head>\r\n@@@body@@@\r\n</html>','2014-03-12 07:24:46',0,0,0,'\r\n\r\n\r\n\r\n<!--\r\n*{\r\n	border: 0px;\r\n	margin: 0px;\r\n}\r\nbody{\r\n	margin:		3px;\r\n	font-size:	9pt;\r\n	font-family:	arial,sans-serif;\r\n}\r\np{\r\n	margin-top: 0px;\r\n	margin-bottom: 0px;\r\n}\r\nh1, h1 a{\r\n	font-size:20pt;\r\n	color:#005677;\r\n}\r\nh2, h2 a {\r\n	font-size:16pt;\r\n	color:#005677;\r\n}\r\nh3, h3 a {\r\n	font-size:12pt;\r\n	color:#005677;